import React, {useEffect} from 'react'
import axios from 'axios'
const Home = () => {
    useEffect(()=>{
        axios.get('http://localhost:5000/')
        .then(res => console.log(res))
        .catch(error => console.log(error))
    },[])
  return (
    <div>Home</div>
  )
}

export default Home
